body:
This issue is that the code processing the function is not handling a node with variadic inputs. Due to that it causes an invalid access to node_op_schema->inputs here as the Concat schema has a single variadic input, but the Concat node itself has 2 inputs:

https://github.com/microsoft/onnxruntime/blob/32c2c4b480c3983de216a92b19ce06b9cf75780c/onnxruntime/core/graph/function_utils.cc#L120-L127

@souptc or @gramalingam could you please take a look?
